import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Ccomponent from "./Ccomponent";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Ccomponent />
  </React.StrictMode>
);

